Dispense as many passports as there are application forms
initialize all passports to default
read application in order

while application:
    form = read_application()
    if form_is_valid(form):
        prev_passport = find_previous_passport(form)
        birthday = form.get('birthday')
        if is_old_enough(birthday, prev_passport):
            prev_passport = issue_passport(birthday, form)
        else:
            form.log('Passport denied: applicant not old enough')
